import React, { Fragment, useEffect, useState } from "react";
import ModelList from "../components/Model/ModelList";
import { useParams } from "react-router-dom";
import axios from "axios";
const VehiclesDetail = () => {
  const params = useParams();
  const getmakeid = params.makeid;
  const modelurl = `https://vpic.nhtsa.dot.gov/api/vehicles/GetModelsForMakeIdd/${getmakeid}?format=json`;
  const [Modellist, SetModellist] = useState([]);
  const [Error, SetError] = useState(false);
  const getModelListingHandler = () => {
    axios
      .get(modelurl)
      .then(({ data }) => {
        const lodedmodels = [];
        for (const key in data.Results) {
          lodedmodels.push({
            Make_Name: data.Results[key].Make_Name,
            Model_Name: data.Results[key].Model_Name,
          });
        }
        SetModellist(lodedmodels);
        SetError(true);
      })
      .catch((error) => {
        //console.log(error.message);
        if (error.message.length !== 0) {
          SetError(true);
        }
      });
  };
  useEffect(() => {
    getModelListingHandler();
  });
  return (
    <Fragment>
      <ModelList items={Modellist} />
    </Fragment>
  );
};
export default VehiclesDetail;
